const BlogList = ({ blogs, createBlog, newTitle, newAuthor, newUrl, handleTitleChange, handleAuthorChange, handleUrlChange, validMessage }) => {
  return (
    <div>

    {blogs.map(blog => (
      <Blog key={blog.id} blog={blog} />
    ))}
    </div>
  )
}

export default BlogList
